import "./editarPlanTrabajo.css"
//import imagenUsuario from '../imagenes/usuario.png';
import { NavLink, useNavigate } from "react-router-dom";


function EditarPlanTrabajo(){

  const navigate = useNavigate(); 

  function Volver (){
    navigate('/MenuPrincipal');

  }
  function funcionEditarPlan (){
    navigate('/ConsulElimiPlanTrabajo');

  }
  function funcionCrearActividad (){
    navigate('/ActividadVM');
  }

  //style={{backgroundImage: `url(${imagenUsuario})`, backgroundSize: 'cover', backgroundRepeat: 'no-repeat'}}

  return(
    <div>
      <label className="barraEditarPlanTrabajo"> </label>
      <label className="nombreUsuarioEditarPlanTrabajo"> Nombre Usuario </label>
      <label className="planTrabajoEditarPlanTrabajo"> Plan de Trabajo </label>


      <label className="nombrePlanTrabajoEditarPlanTrabajo"> Nombre del plan de trabajo </label>
      <label className="actvividadEditarPlanTrabajo"> Actividades </label>




      <input  name = 'nombrePlanTrabajp'  id = 'npt' type="text"  placeholder="" className='inputNEditarPlanTrabajo' style={{ width: 350 , height: 50, color: 'black' }}/>

      <div className="actividadesEditarPlanTrabajo" style={{ height: "200px", overflow: "auto" }}> 

      </div>

      <button onClick={funcionEditarPlan} className="botonEditarPlanTrabajo"> Editar plan de trabajo </button>
      <button onClick={funcionCrearActividad} className="crearActividadEditarPlanTrabajo"> Crear Actividad </button>


      <button className="botonPersonaEditarPlanTrabajo" >  </button>
      <button onClick={Volver} className="botonVolverEditarPlanTrabajo"> Volver </button>

    </div>


  )
}


export default EditarPlanTrabajo;
